export default {
  title: 'ActionPanel',
  component: ActionPanel,
};

export function ActionPanelContainer({
  action,
  formId,
  type,
  resetForm,
  disabled,
  loading,
}) {

  const classes = actionPanelStyles();

  return (
    <BrowserRouter>
    <h3>Action Panel</h3>
    <ActionPanel
            action="addRecipientChild"
            type="submit"
            formId="add-new-recipient"
            resetForm={action("I've been clicked")}
            loading={loadingState}
            disabled={loadingState}
          />
    </BrowserRouter>
  );
}
